import React from "react";
import SelectLang from "../components/GetStarted/SelectLang";
import SingInBtn from "../components/GetStarted/SingInBtn";
import NetflixLogo from "../components/NetflixLogo";

const GetStarted = () => {
  return (
    <div>
      <nav className="flex justify-between items-center px-14 pt-7">
        <NetflixLogo />
        <div className="lang-signin">
          <SelectLang />
          <SingInBtn />
        </div>
      </nav>

      <img
        src="https://assets.nflxext.com/ffe/siteui/vlv3/a43711df-c428-4f88-8bb3-b2ac5f20608f/20381feb-65a6-4351-be55-57df47e98e91/TR-en-20230227-popsignuptwoweeks-perspective_alpha_website_large.jpg"
        alt=""
      />
    </div>
  );
};

export default GetStarted;
